import React, {useState} from 'react';
import {Ship, ShipSection} from './ShipSection';

export const CalculateFormContainer = () => {
  const [ship, setShip] = useState<Ship>({name: '', country: ''});

  return (
    <form>
      <ShipSection ship={ship} setShip={setShip}/>
    </form>
  );
};
